import React from "react";
import Card  from "./Card";
import Contacts from "../contacts";

function App() {
  return (<div>
    <h1 className="heading">My Contacts</h1>
    <Card name = {Contacts[0].name} phone ={Contacts[0].phone}  imgUrl={Contacts[0].imgUrl} email={Contacts[0].email}/>
    <Card name = {Contacts[1].name} phone ={Contacts[1].phone}  imgUrl={Contacts[1].imgUrl} email={Contacts[1].email}/>
      </div>
      );
}

export default App;
